import FormInput from "../components/form-input/form-input.component.jsx";

const LoginPage = () => {
  return (
    <div id="login-page">
      <form id="login-form">
        <FormInput
          id="login-email"
          type="email"
          name="email"
          value="Email"
          label="email"/>
      </form>
    </div>
  );
};

export default LoginPage;
